!function(){var countDownDate=new Date("October 26, 2019 15:00:00").getTime(),x=setInterval(function(){var now=(new Date).getTime(),distance=countDownDate-now,days=Math.floor(distance/864e5),hours=Math.floor(distance%864e5/36e5),minutes=Math.floor(distance%36e5/6e4),seconds=Math.floor(distance%6e4/1e3);document.getElementById("days").innerHTML=days+" <small>days</small>",document.getElementById("hours").innerHTML=hours+" <small>hours</small> ",document.getElementById("minutes").innerHTML=minutes+" <small>minutes</small> ",document.getElementById("seconds").innerHTML=seconds+" <small>seconds</small> ",distance<0&&(clearInterval(x),document.getElementById("demo").innerHTML="That's all folks!!")},1e3)}();